        /// <summary>
        /// 添加代理帐号(测试)
        /// </summary>
        /// <param name="loginName">登录名称</param>
        /// <param name="password">登录密码</param>
        /// <param name="type">账号类型 1：超级管理 2：账务</param>
        /// <returns></returns>
        [HttpGet]
        [NotAuthentication]
        public async Task<IActionResult> AddAgentUser(string loginName, string password, ManagementTypeEnum type)
        {
            var flag = await agentUserOperation.GetModelAsync(t => t.LoginName == loginName);
            if (flag != null) return Ok(new RecoverModel(RecoverEnum.失败, "已存在相同名称账号！"));
            if (type == ManagementTypeEnum.普通类型)
                return Ok(new RecoverModel(RecoverEnum.失败, "此接口不能添加普通账号！"));

            var result = new AgentUser()
            {
                LoginName = loginName,
                //Password = Utils.MD5(password),
                Password = password,
                SafePassWord = Utils.MD5("888888"),
                ManagementType = type
            };
            if (type == ManagementTypeEnum.超级管理类型)
            {
                //查询是否已有超级管理帐号
                var exic = await agentUserOperation.GetModelAsync(t => t.IsHighest == true);
                if (exic != null) return Ok(new RecoverModel(RecoverEnum.失败, "已存在超级管理员"));
                result.IsHighest = true;
                result.HighestAgentID = result._id;
            }
            await agentUserOperation.InsertModelAsync(result);
            AdvancedSetupOperation advancedSetupOperation = new AdvancedSetupOperation();
            var advanced = new AdvancedSetup()
            {
                AgentID = result._id
            };
            await advancedSetupOperation.InsertModelAsync(advanced);
            return Ok(new RecoverModel(RecoverEnum.成功, "添加成功！"));
        }

        /// <summary>
        /// 账号登录
        /// </summary>
        /// <param name="loginName">登录名称</param>
        /// <param name="password">登录密码</param>
        /// <param name="code">安全码</param>
        /// <returns></returns>
        [HttpGet]
        [NotAuthentication]
        public async Task<IActionResult> AgentUserLogin(string loginName, string password, string code)
        {
            if (HttpContext.User.FindFirstValue("Code") == null) return Ok(new RecoverModel(RecoverEnum.参数错误, "请重新获取验证码！"));
            if (HttpContext.User.FindFirstValue("Code").ToLower() != code.ToLower())
                return Ok(new RecoverModel(RecoverEnum.参数错误, "验证码错误！"));
            var result = await agentUserOperation.GetModelAsync(t => t.LoginName == loginName);
            if (result == null) return Ok(new RecoverModel(RecoverEnum.未查询到相关数据, "未查询到帐号信息！"));
            if (result.LockTime != null)
            {
                if (result.LockTime >= DateTime.Now)
                    return Ok(new RecoverModel(RecoverEnum.失败, string.Format("帐号已被锁定，请在{0}后登录", result.LockTime.Value.ToString("yyyy-MM-dd HH:mm:ss"))));
            }
            if (string.IsNullOrEmpty(HttpContext.Session.GetString("Pwd")))
            {
                if (password != result.Password)
                {
                    var count = HttpContext.Session.GetInt32("ErrorCount") == null ? 0 : HttpContext.Session.GetInt32("ErrorCount").Value;
                    HttpContext.Session.SetInt32("ErrorCount", count + 1);
                    if (count + 1 >= 3)
                    {
                        result.LockTime = DateTime.Now.AddMinutes(10);
                        await agentUserOperation.UpdateModelAsync(result);
                        return Ok(new RecoverModel(RecoverEnum.失败, "输入错误三次，锁定10分钟！"));
                    }
                    return Ok(new RecoverModel(RecoverEnum.未查询到相关数据, "帐号或密码错误！"));
                }
            }
            else
            {
                if (HttpContext.Session.GetString("Pwd") != password)
                {
                    var count = HttpContext.Session.GetInt32("ErrorCount") == null ? 0 : HttpContext.Session.GetInt32("ErrorCount").Value;
                    HttpContext.Session.SetInt32("ErrorCount", count + 1);
                    if (count + 1 >= 3)
                    {
                        result.LockTime = DateTime.Now.AddMinutes(10);
                        await agentUserOperation.UpdateModelAsync(result);
                        return Ok(new RecoverModel(RecoverEnum.失败, "输入错误三次，锁定10分钟！"));
                    }
                    return Ok(new RecoverModel(RecoverEnum.未查询到相关数据, "帐号或密码错误！"));
                }
            }
            if (result.Status == AgentStatusEnum.锁定)
                return Ok(new RecoverModel(RecoverEnum.失败, "帐号已被锁定,请联系上级代理！"));
            #region 添加cookie和redis
            string token = Guid.NewGuid().ToString();
            var key = result.IsHighest ? result.LoginName + ":" + token :
                result.LoginName + ":" + result._id;
            var claims = new List<Claim>()
            {
                new Claim("Token",token),
                new Claim("LoginName",result.LoginName),
                new Claim("AgentID",result._id),
                new Claim("IsHighest", result.IsHighest ? "1":"2"),
                new Claim("Type", ((int)result.ManagementType).ToString())
            };
            var claimsIdentity = new ClaimsIdentity(
                        claims, CookieAuthenticationDefaults.AuthenticationScheme);

            //特定
            var authProperties = new AuthenticationProperties
            {

            };

            await HttpContext.SignInAsync(
                CookieAuthenticationDefaults.AuthenticationScheme,
                new ClaimsPrincipal(claimsIdentity),
                authProperties);
            Dictionary<string, string> dic = new Dictionary<string, string>();
            dic.Add("Token", token);
            dic.Add("LoginName", result.LoginName);
            dic.Add("AgentID", result._id);
            dic.Add("Type", result.ManagementType.ToString());
            RedisOperation.UpdateCacheKey(key, dic, 20);
            #endregion

            #region 修改ip
            var ip = HttpContext.GetIP();
            result.LockTime = null;
            result.ErrorCount = 0;
            result.LastLoginIP = ip;
            result.LastLoginTime = DateTime.Now;
            await agentUserOperation.UpdateModelAsync(result);
            #endregion
            var callback = new
            {
                result.LoginName,
                IP = result.LastLoginIP,
                result.IsHighest,
                Type = result.ManagementType
            };
            return Ok(new RecoverClassModel<dynamic>()
            {
                Status = RecoverEnum.成功,
                Message = "登录成功！",
                Model = callback
            });
        }

        /// <summary>
        /// 获取登录帐号密码位置 
        /// </summary>
        /// <param name="loginName">登录帐号</param>
        /// <returns></returns>
        [HttpGet]
        [NotAuthentication]
        public async Task<FileContentResult> GetPwdPosition(string loginName)
        {
            var agent = await agentUserOperation.GetModelAsync(t => t.LoginName == loginName);
            if (agent == null) return null;
            if (agent.ManagementType != ManagementTypeEnum.超级管理类型)
                return null;
            var max = agent.Password.Length > 9 ? 9 : agent.Password.Length;
            Random random = new Random();
            var pwd = agent.Password.ToArray();
            var result = string.Empty;
            var pwdResult = string.Empty;
            for (int i = 0; i < 4; i++)
            {
                var num = random.Next(0, max);
                result += (num + 1).ToString();
                pwdResult += pwd[num].ToString();
            }
            #region 添加cookie
            HttpContext.Session.SetString("Pwd", pwdResult);
            #endregion
            var bitmap = VerifyCodeHelper.GetSingleObj().CreateBitmapByImgVerifyCode(result, 100, 40);
            MemoryStream stream = new MemoryStream();
            bitmap.Save(stream, ImageFormat.Gif);
            return File(stream.ToArray(), "image/gif");
        }

