        /// <summary>
        /// 创建代理帐号
        /// </summary>
        /// <param name="loginName">用户名</param>
        /// <param name="password">密码</param>
        /// <param name="price">代理价格</param>
        /// <returns></returns>
        [HttpPost]
        public async Task<IActionResult> CreateAgentAccount(string loginName, string password, decimal price)
        {
            var agentID = HttpContext.User.FindFirstValue("AgentID");
            loginName = loginName.Trim();
            password = password.Trim();
            //判断已注册数量
            var count = await agentUserOperation.GetCountAsync(t => t.SupAgentID == agentID);
            var agent = await agentUserOperation.GetModelAsync(t => t._id == agentID);
            if (agent.OpenAgentNum <= count)
                return Ok(new RecoverModel(RecoverEnum.失败, "创建账号已达上限!"));
            var flag = await agentUserOperation.GetModelAsync(t => t.LoginName == loginName);
            if (flag != null) return Ok(new RecoverModel(RecoverEnum.失败, "已存在相同名称账号！"));
            //查询极差
            if (!string.IsNullOrEmpty(agent.HighestAgentID))
            {
                var advancedSetupOperation = new AdvancedSetupOperation();
                var preAgent = await advancedSetupOperation.GetModelAsync(t => t.AgentID == agent.HighestAgentID);
                if (price - agent.SubAgentPrice < preAgent.AgencyMargin)
                    return Ok(new RecoverModel(RecoverEnum.失败, string.Format("设置的下级代理价格需大于自己代理价格（{0}）以上！", preAgent.AgencyMargin)));
            }
            var result = new AgentUser()
            {
                LoginName = loginName,
                //Password = Utils.MD5(password),
                Password = password,
                SupAgentID = agentID,
                SubAgentPrice = price,
                SafePassWord = Utils.MD5("888888"),
                HighestAgentID = agent.IsHighest ? agentID : agent.HighestAgentID
            };
            await agentUserOperation.InsertModelAsync(result);
            return Ok(new RecoverModel(RecoverEnum.成功, "添加成功！"));
        }

