        /// <summary>
        /// 验证安全密码
        /// </summary>
        /// <param name="safePwd">安全密码</param>
        /// <returns></returns>
        [HttpGet]
        public async Task<IActionResult> VerifySecurePwd(string safePwd)
        {
            var agentID = HttpContext.User.FindFirstValue("AgentID");

            var agent = await agentUserOperation.GetModelAsync(t => t._id == agentID);
            if (agent.SafePassWord != Utils.MD5(safePwd))
            {
                agent.ErrorCount += 1;
                if (agent.ErrorCount != 3)
                {
                    await agentUserOperation.UpdateModelAsync(agent);
                    return Ok(new RecoverModel(RecoverEnum.失败,
                        "安全密码错误！"));
                }
                else
                {
                    agent.LockTime = DateTime.Now.AddMinutes(10);
                    await agentUserOperation.UpdateModelAsync(agent);

                    #region 清除cookie和redis
                    await UserExit();
                    #endregion
                    return Ok(new RecoverModel(RecoverEnum.失败,
                        "安全密码输入错误3次，帐号已被锁定！"));
                }
            }
            return Ok(new RecoverModel(RecoverEnum.成功,
                        "验证成功！"));
        }

