        /// <summary>
        /// 申请提现
        /// </summary>
        /// <param name="applyType">申请类型  1:银行卡 2:支付宝</param>
        /// <param name="amount">金额</param>
        /// <returns></returns>
        [HttpGet]
        public async Task<IActionResult> ApplyWithdrawal(ApplyTypeEnum applyType, decimal amount)
        {
            var agentID = HttpContext.User.FindFirstValue("AgentID");
            CashWithdrawalOperation cashWithdrawalOperation = new CashWithdrawalOperation();
            var count = await cashWithdrawalOperation.GetCountAsync(t => t.ApplyAgentID == agentID
                && t.CreatedTime >= DateTime.Today && t.CreatedTime <= DateTime.Now);
            if (count >= 3)
                return Ok(new RecoverModel(RecoverEnum.失败, "每日提现次数不能超过3次!"));

            var agent = await agentUserOperation.GetModelAsync(t => t._id == agentID);
            if (agent.UserBalance - agent.CleanCode < amount)
                return Ok(new RecoverModel(RecoverEnum.失败, "可提现余额不足！"));
            var acceptance = string.Empty;
            if (applyType == ApplyTypeEnum.支付宝)
            {
                AlipayInfoOperation alipayInfoOperation = new AlipayInfoOperation();
                var model = await alipayInfoOperation.GetModelAsync(t => t.AgentID == agentID);
                if (model == null)
                    return Ok(new RecoverModel(RecoverEnum.失败, "还未绑定支付宝，不能提现！"));
                acceptance = model.Account + "&" + model.QRPath;
            }
            else if (applyType == ApplyTypeEnum.银行卡)
            {
                BankInfoOperation bankInfoOperation = new BankInfoOperation();
                var model = await bankInfoOperation.GetModelAsync(t => t.AgentID == agentID);
                if (model == null)
                    return Ok(new RecoverModel(RecoverEnum.失败, "还未绑定银行卡，不能提现！"));
                acceptance = model.BankNum;
            }
            else if (applyType == ApplyTypeEnum.泰达币)
            {
                VirtualCurrencyOperation virtualCurrencyOperation = new VirtualCurrencyOperation();
                var model = await virtualCurrencyOperation.GetModelAsync(t => t.AgentID == agentID);
                if (model == null)
                    return Ok(new RecoverModel(RecoverEnum.失败, "还未绑定泰达币，不能提现！"));
                if (!model.CurrencyInfo.Exists(t => t.CurrencyType == CurrencyEnum.泰达币))
                    return Ok(new RecoverModel(RecoverEnum.失败, "还未绑定泰达币，不能提现！"));
                acceptance = model.CurrencyInfo.Find(t => t.CurrencyType == CurrencyEnum.泰达币).CurrencyPath;
            }
            //添加记录
            var result = new CashWithdrawal()
            {
                AcceptanceAgentID = agent.HighestAgentID,
                ApplyAgentID = agentID,
                Amount = amount,
                ApplyType = applyType,
                ApplyAgentName = agent.LoginName,
                Acceptance = acceptance
            };
            await cashWithdrawalOperation.InsertModelAsync(result);
            await agentUserOperation.DownScore(agentID, amount, AccountTypeEnum.余额提现, string.Format("{0}[{1}]", Enum.GetName(typeof(ApplyTypeEnum), applyType), acceptance), false, false);

            return Ok(new RecoverModel(RecoverEnum.成功, "申请提现成功！"));
        }

        /// <summary>
        /// 代理转账
        /// </summary>
        /// <param name="applyName">下级代理名称</param>
        /// <param name="amount">金额</param>
        /// <returns></returns>
        [HttpPost]
        public async Task<IActionResult> TransferAccounts(string applyName, decimal amount)
        {
            var agentID = HttpContext.User.FindFirstValue("AgentID");
            var agent = await agentUserOperation.GetModelAsync(t => t._id == agentID);
            if (agent.UserBalance < amount)
                return Ok(new RecoverModel(RecoverEnum.失败, "可转账余额不足！"));
            //判断转账对象是否为下级一级代理
            var target = await agentUserOperation.GetModelAsync(t => t.LoginName == applyName && t.SupAgentID == agentID);
            if (target == null) return Ok(new RecoverModel(RecoverEnum.失败, "该代理不为您的下级代理，不能转账！"));
            await agentUserOperation.DownScore(agentID, amount, AccountTypeEnum.转账, string.Format("目标代理[{0}]", applyName), false, true);
            //增加目标代理
            await agentUserOperation.UpScore(target._id, amount, AccountTypeEnum.转账, string.Format("转账代理[{0}]", agent.LoginName), true);
            return Ok(new RecoverModel(RecoverEnum.成功, "转账成功！"));
        }

