        /// <summary>
        /// 兑换码充值
        /// </summary>
        /// <param name="redeemCode">兑换码</param>
        /// <returns></returns>
        [HttpPost]
        public async Task<IActionResult> ApplyRedeemCode(string redeemCode)
        {
            var agentID = HttpContext.User.FindFirstValue("AgentID");

            var agent = await agentUserOperation.GetModelAsync(t => t._id == agentID);
            RedeemOperation redeemOperation = new RedeemOperation();
            //查询兑换码
            var redeem = await redeemOperation.GetModelAsync(t => t.AgentID == agent.HighestAgentID
            && t.RedeemCode == redeemCode);
            if (redeem == null) return Ok(new RecoverModel(RecoverEnum.失败, "兑换码错误！"));
            if (redeem.Status == RedeemEnum.已使用) return Ok(new RecoverModel(RecoverEnum.失败, "该兑换码已使用！"));
            if (redeem.EffectiveTime < DateTime.Now) return Ok(new RecoverModel(RecoverEnum.失败, "兑换码已失效！"));
            //修改状态
            redeem.Status = RedeemEnum.已使用;
            redeem.UseAgentID = agentID;
            redeem.UseAgentName = agent.LoginName;
            redeem.UseTime = DateTime.Now;
            await redeemOperation.UpdateModelAsync(redeem);
            //加款
            await agentUserOperation.UpScore(agent._id, redeem.Amount, AccountTypeEnum.余额充值, "兑换码充值成功", true);

            //添加充值记录
            RechargeOperation rechargeOperation = new RechargeOperation();
            var recharge = new Recharge()
            {
                OrderType = "充值余额[兑换码充值]\r\n" + "兑换码：" + redeemCode,
                ApplyAgentID = agent._id,
                AcceptanceAgentID = agent.HighestAgentID,
                ActualAmount = redeem.Amount + agent.UserBalance,
                Amount = redeem.Amount,
                ApplyAgentName = agent.LoginName,
                IsHandle = true
            };
            await rechargeOperation.InsertModelAsync(recharge);
            return Ok(new RecoverModel(RecoverEnum.成功, "操作成功"));
        }

