        /// <summary>
        /// 获取首页代理个人基本信息
        /// </summary>
        /// <response>
        /// ## 返回结果
        ///     {
        ///         Status：返回状态
        ///         Message：返回消息
        ///         Total：数据总数量
        ///         Data
        ///         {
        ///             AgentName：帐号名称
        ///             TeamNum：团队人数
        ///             IP：登录ip
        ///             Balance：余额
        ///             SaleNum：今日销售量
        ///             TeamBalance：团队余额
        ///         }
        ///     }
        /// </response>
        /// <returns></returns>
        [HttpGet]
        public async Task<IActionResult> GetAgentInfo()
        {
            var agentID = HttpContext.User.FindFirstValue("AgentID");
            var agent = await agentUserOperation.GetModelAsync(t => t._id == agentID);

            //团队数
            var agentList = await agentUserOperation.GetAgentList(agentID);
            agentList.RemoveAll(t => t.AgentID == agentID);
            var agentAllList = await agentUserOperation.GetModelListAsync(agentUserOperation.Builder.In(t => t._id, agentList.Select(t => t.AgentID).ToList()));
            //今日销售量
            SalesRecordsOperation salesRecordsOperation = new SalesRecordsOperation();
            var todaySales = await salesRecordsOperation.GetCountAsync(t => t.AgentID == agentID && t.SalesType != SalesTypeEnum.临时 &&
            t.CreatedTime >= DateTime.Today && t.CreatedTime <= DateTime.Now);

            dynamic result = new
            {
                AgentName = agent.LoginName,
                IP = agent.LastLoginIP,
                TeamNum = agentList.Count,
                Balance = agent.UserBalance,
                SaleNum = todaySales,
                TeamBalance = agentAllList.Sum(t => t.UserBalance)
            };
            return Ok(new RecoverClassModel<dynamic>()
            {
                Message = "获取成功",
                Model = result,
                Status = RecoverEnum.成功
            });
        }

        /// <summary>
        /// 获取团队情况
        /// </summary>
        /// <param name="startTime">开始时间</param>
        /// <param name="endTime">结束时间</param>
        /// <returns></returns>
        [HttpGet]
        public async Task<IActionResult> SearchReapProfit(DateTime startTime, DateTime endTime)
        {
            var agentID = HttpContext.User.FindFirstValue("AgentID");

            var agent = await agentUserOperation.GetModelAsync(t => t._id == agentID);

            var agentList = await agentUserOperation.GetAgentList(agentID);
            agentList.RemoveAll(t => t.AgentID == agentID);
            var agentIDList = agentList.Select(t => t.AgentID).ToList();
            //团队新增代理
            var newAddAgentIDList = agentList.Where(t => t.CreateTime >= startTime && t.CreateTime <= endTime).ToList();
            //销售
            SalesRecordsOperation salesRecordsOperation = new SalesRecordsOperation();
            var salesNum = await salesRecordsOperation.GetCountAsync(salesRecordsOperation.Builder.Where(t => t.CreatedTime >= startTime && t.CreatedTime <= endTime && t.SalesType != SalesTypeEnum.临时)
                & salesRecordsOperation.Builder.In(t => t.AgentID, agentIDList));
            //提现
            CashWithdrawalOperation cashWithdrawalOperation = new CashWithdrawalOperation();
            var cashList = await cashWithdrawalOperation.GetModelListAsync(cashWithdrawalOperation.Builder.Where(t => t.Status == WithdrawalStatusEnum.已放款 && t.CreatedTime >= startTime && t.CreatedTime <= endTime)
                & cashWithdrawalOperation.Builder.In(t => t.ApplyAgentID, agentIDList));
            var cashNum = cashList.Sum(t => t.Amount);

            //返利
            AccountingRecordOperation accountingRecordOperation = new AccountingRecordOperation();
            var accountList = await accountingRecordOperation.GetModelListAsync(t => t.Type == AccountTypeEnum.团队返利 && t.CreatedTime >= startTime && t.CreatedTime <= endTime && t.AgentID == agentID);
            var accountNum = accountList.Sum(t => t.VariableAmount);

            //商户
            MerchantOperation merchantOperation = new MerchantOperation();
            var merchantCount = await merchantOperation.GetCountAsync(merchantOperation.Builder.In(t => t.AgentID, agentIDList) &
                merchantOperation.Builder.Where(t => t.CreatedTime >= startTime && t.CreatedTime <= endTime));

            dynamic result = new
            {
                NewAgentNum = newAddAgentIDList.Count,
                SalesNum = salesNum,
                CashNum = cashNum,
                AccountNum = accountNum,
                MerchantNum = merchantCount
            };
            return Ok(new RecoverClassModel<dynamic>()
            {
                Message = "获取成功",
                Model = result,
                Status = RecoverEnum.成功
            });
        }
        #endregion

